    public class func drawProfileOverlay() {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let gradient3Color2 = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 0.000)
        let gradient3Color3 = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 0.000)

        //// Gradient Declarations
        let gradient3 = CGGradientCreateWithColors(CGColorSpaceCreateDeviceRGB(), [UIColor.whiteColor().CGColor, UIColor.whiteColor().blendedColorWithFraction(0.5, ofColor: gradient3Color2).CGColor, gradient3Color2.CGColor, gradient3Color3.CGColor, gradient3Color3.blendedColorWithFraction(0.5, ofColor: UIColor.whiteColor()).CGColor, UIColor.whiteColor().CGColor], [0, 0.05, 0.11, 0.87, 0.93, 1])!

        //// Rectangle 2 Drawing
        let rectangle2Path = UIBezierPath(rect: CGRectMake(0, 0, 230, 315))
        CGContextSaveGState(context)
        rectangle2Path.addClip()
        CGContextDrawLinearGradient(context, gradient3, CGPointMake(230, 157.5), CGPointMake(-0, 157.5), CGGradientDrawingOptions())
        CGContextRestoreGState(context)


        //// Rectangle Drawing
        let rectanglePath = UIBezierPath(rect: CGRectMake(0, 0, 230, 315))
        CGContextSaveGState(context)
        rectanglePath.addClip()
        CGContextDrawLinearGradient(context, gradient3, CGPointMake(115, 315), CGPointMake(115, 0), CGGradientDrawingOptions())
        CGContextRestoreGState(context)
    }

